import React, {useState, useEffect} from "react";

const CourseScorecard = props => {
    return(
        <>
            <table>
                <form>
                    <tr>
                        <td>
                            <label for="name">
                                Name
                            </label>
                        </td>
                        <td><input type="number" id="name" /></td>
                    </tr>
                </form>
            </table>
        </>

    )
}
export default CourseScorecard;
